    height: "25%",
    left: "calc(50% - 234px/2 - 0.48px)",
    top: "calc(50% - 80px/2 - 76px)",

  }
  const style_button_recherche = {
    width: "35%",
    height: "25%",
    left: "calc(50% - 353px/2 + 0.02px)",
    top: "calc(50% - 80px/2 + 19px)",
  }
  const style_button_db = {
    width: "55%",
    height: "25%",
    left: "calc(50% - 451px/2 - 0.98px)",
    top: "calc(50% - 80px/2 + 114px)",
  }

  return (
    <div className="background">
      <menu className="Menu">
        <div className="logo"></div>
        <div className="button-container">
          <Link to="/Craft" className="button-menu" style={style_button_carft} >Craft</Link>
          <Link to="/Recherche" className="button-menu" style={style_button_recherche} >Recherche</Link>
          <Link to="/BDD" className="button-menu" style={style_button_db} >Base de donn√©e</Link>
        </div>
      </menu>
    </div>
  );
}

export default HomePage;
